import { useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

import './form.css';

function validate(input) {
   let error = [];
   let letter = /^([^a-zA-Z/@!?|~#^&%*=+-:;.,$¿¡`'"_<>{}()]*)$/; // no permite letras ni simbolos
   let symbol = /^([^/@!?|~#^&%*=+-:;.,$¿¡`'"_<>{}()]*)$/; // no permite numeros ni simbolos
   let symbol2 = /^([^/@!?|~#^&%*=+:;.,$¿¡`'"_<>{}()]*)$/; // no permite simbolos excepto el "-"
   let symbol3 = /^([^/@!?|~#^&%*=+:;.$¿¡`'"_<>{}()]*)$/; // no permite numeros ni simbolos excepto la ","

   if (!symbol.test(input.name)) {
      error.name = "No se permiten numeros ni simbolos"
   }
   if (!letter.test(input.weight)) {
      error.weight = "No se permiten letras, solo numeros y -"
   }
   if (!letter.test(input.height)) {
      error.height = "No se permiten letras, solo numeros y -"
   }
   if (!symbol2.test(input.life_span)) {
      error.life_span = "No se permiten simbolos, solo -"
   }
   if (!symbol3.test(input.temperament)) {
      error.temperament = "No se permiten numeros ni simbolos, solo ,"
   }

   return error;
}

function Form() {
   const [formData, setFormData] = useState({
      name: "",
      image: "",
      minHeight: "",
      maxHeight: "",
      minWeight: "",
      maxWeight: "",
      minLife_span: "",
      maxLife_span: "",
      temperament: [],
   });

   const [error, setError] = useState({
      name: "",
      minHeight: "",
      maxHeight: "",
      minWeight: "",
      maxWeight: "",
      minLife_span: "",
      maxLife_span: "",
   })

   function handleChange(e) {
      // setInput({
      //    ...input,
      //    [e.target.name]: e.target.value,
      // })
      // setError(validate({
      //    ...input,
      //    [e.target.name]: e.target.value,
      // }))

      const { name, value } = e.target;
      setFormData({ ...formData, [name]: value });
      validate({ ...error, [name]: value })

   }

   const handleSubmit = async (e) => {
      e.preventDefault()
      if (!formData.name || !formData.temperament) {
         alert('Por favor, complete los campos obligatorios.');
         return;
      }

      try {
         let newDog = {
            name: formData.name,
            image: formData.image,
            weight: `${formData.minWeight} - ${formData.maxWeight}`,
            height: `${formData.minHeight} - ${formData.maxHeight}`,
            life_span: `${formData.minLife_span} - ${formData.maxLife_span}`,
            temperament: [formData.temperament]
         }
         await axios.post('http://localhost:3001/postdogs', newDog)


         window.alert("La raza a sido creada con exito! :D")

      } catch (error) {
         console.error('Error al enviar los datos al servidor:', error);
         window.alert('Hubo un error al crear la raza de perro :C');
      }
   }

   return (
      <div>
         <form onSubmit={handleSubmit}>
            <h1>Raza Add Page</h1>

            <label> Name:
               <input type='text' placeholder='Raza name' name="name" value={formData.name} onChange={handleChange} /> <br />
               {/* <label>{error.name}</label> */}
            </label>

            <label> Minimum weight: </label>
            <input type='number' placeholder='Min' name="minWeight" value={formData.minWeight} onChange={handleChange} /> <br />

            <label>Maximum weight: </label>
            <input type='number' placeholder='Max' name="maxWeight" value={formData.maxWeight} onChange={handleChange} /> <br />

            <label> Minimum height: </label>
            <input type='number' placeholder='Min' name="minHeight" value={formData.minHeight} onChange={handleChange} /> <br />

            <label> Maximum height: </label>
            <input type='number' placeholder='Max' name="maxHeight" value={formData.maxHeight} onChange={handleChange} /> <br />

            <label> Minimum years of life: </label>
            <input type='number' placeholder='Min' name="minLife_span" value={formData.minLife_span} onChange={handleChange} /> <br />

            <label> Maximum years of life: </label>
            <input type='number' placeholder='Max' name="maxLife_span" value={formData.maxLife_span} onChange={handleChange} /> <br />

            <label> Temperaments: </label>
            <input type='text' placeholder='more usual' name="temperament" value={formData.temperament} onChange={handleChange} /> <br />

            <label> Image: </label>
            <input type='text' placeholder='URL (not required)' name="image" value={formData.image} onChange={handleChange} /> <br />

            <button type="submit">Enviar</button>
            <Link to="/home">
               <button>Home</button>
            </Link>
         </form>
      </div>
   );
}

export default Form;
